import React from 'react'
import BasePageHugeCard from '../pages/BasePages/BasePageHugeCard.js'
import SecretaryHugeTable from '../components/Tables/SecretaryTableData/SecretaryHugeTable'


function SecretaryTableData({secretaryData, info_for_table}) {
  return (
    <>
    <BasePageHugeCard isAuthenticated={true} data={secretaryData}>
    <SecretaryHugeTable info_for_table={info_for_table}/>
    </BasePageHugeCard>
    </>
  )
}

export default SecretaryTableData
